INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (13, 'How to best optimize React components for a high-load application?', 'My app has started to slow down due to the large amount of data processed by components. I want to understand the best approaches for memoization, using context, or optimizing keys.', 'active', 0, 9, 5, '2024-07-29 22:31:32');
INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (23, 'Why is my REST API slower after adding a new module?', 'After integrating an image processing module, the API has noticeably slowed down. How to find the issue and optimize speed?', 'active', 0, 7, 8, '2024-10-01 12:46:09');
INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (22, 'How to integrate Docker into an existing project?', 'My team is planning to switch to Docker, but we already have a large project with multiple services. How to create an effective Dockerfile and structure containers?', 'active', 0, 6, 4, '2024-07-02 08:55:18');
INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (25, 'How to integrate Firebase Authentication into a Flutter app?', 'I am developing a mobile app and want to add login functionality using Google and Facebook. Are there any pitfalls to watch out for?', 'active', 0, 5, 1, '2024-06-07 02:28:11');
INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (1, 'How to migrate from MySQL to PostgreSQL without losing data?', 'I want to migrate the database in my project to a more flexible solution. How can I do it safely?', 'inactive', 0, 5, 6, '2024-08-06 15:45:53');
INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (21, 'How to train a model to recognize emotions in text?', 'I am working on a chatbot project that will respond to user emotions. The goal is to identify the tone of messages (positive, neutral, negative) using machine learning. What algorithms are best for text analysis, and should I use pre-trained models like BERT?', 'active', 0, 5, 1, '2024-07-29 00:51:56');
