INSERT INTO DevSync.posts (id, title, content, status, isTop, likes, createdById, createdAt) VALUES (9, 'What risks arise when using NoSQL databases for financial applications?', 'I am considering MongoDB for a financial app. Are there specific risks related to the lack of transactions? How to ensure data integrity and consistency in NoSQL? Perhaps it’s better to combine SQL and NoSQL?', 'active', 1, 2, 1, '2024-06-14 17:58:14');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (1, 'Frontend Development', 'A category for discussing the creation of modern web interfaces. Share experiences with HTML, CSS, and JavaScript, as well as popular frameworks like React, Angular, or Vue.js. Discuss best design practices, frontend application performance, and tools to improve development efficiency. Enhance your skills, explore trends, and dive into real-world cases.', '2024-06-15 18:03:59');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (2, 'Backend Development', 'A category for everything related to server-side programming and architecture. Questions about working with databases (SQL, NoSQL), creating APIs, and using server frameworks like Django, Flask, Laravel, or Express. Learn how to ensure security, scalability, and stability of the backend. Share your experience in optimizing server processes and solving complex tasks.', '2024-08-21 23:05:42');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (3, 'DevOps and CI/CD', 'Here, you can find discussions about tools and automation practices for developers and system administrators. How to set up CI/CD processes using Jenkins, GitHub Actions, or GitLab CI/CD? What are the most effective approaches to using Docker and Kubernetes? Learn how to ensure reliability and speed in deploying applications in any environment.', '2024-11-13 13:05:20');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (4, 'Mobile Development', 'A category for mobile app developers for iOS and Android. Discussions about working with frameworks like Swift, Kotlin, React Native, or Flutter. How to optimize the performance of mobile apps and improve UX? Share experiences in testing, publishing, and monetizing apps.', '2024-07-31 23:45:49');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (5, 'Database Management', 'A category for everyone working with databases, regardless of experience level. How to design a database correctly, optimize queries, and choose between SQL and NoSQL solutions? Discussions about popular technologies like PostgreSQL, MongoDB, MySQL, and others. Share your approaches to backups, scaling, and data integration.', '2024-11-10 22:25:40');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (6, 'AI and Machine Learning', 'A section for developers working with artificial intelligence and machine learning. Learn about using TensorFlow, PyTorch, Scikit-learn, and cloud services for data processing. How to train a model and integrate it into a project? Discuss the latest trends, from GPT to computer vision.', '2024-07-11 13:48:30');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (7, 'Cybersecurity', 'A category dedicated to securing software and data. How to protect a web application from attacks like SQL Injection or XSS? Discuss tools for monitoring and vulnerability testing, encryption principles, and user data protection. Learn to recognize threats and create secure code.', '2024-09-28 11:25:41');
INSERT INTO DevSync.categories (id, title, description, createdAt) VALUES (8, 'Testing and QA', 'A place to discuss tools and practices for software testing. How to ensure product quality through automated or manual testing? Discuss tools like Selenium, Cypress, Postman, and others. Share experiences with test cases, integration tests, and managing the QA process in a team.', '2024-07-26 00:12:22');
